package project5;

public class fibonaric {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int count=6;
		int num1=0;
		int num2=1;
		for(int i=1;i<=count;i++)
		{
			int sumofperetwo=num1+num2;
			num1=num2;
			num2=sumofperetwo;
			
		
		System.out.println(num1);

	}}

}
